import React, { useState, useEffect } from 'react'
import Search from './Search'

const App = ( props ) => {

  const [ newValue, setValue ] = useState('')

  const handleValueChange = (event) => {
    setValue(event.target.value)
  }

  return (
    <Search
      handleValueChange={handleValueChange}
      newValue={newValue}
    />
  )
}

export default App;
